import React from 'react'
import {useLocation as UseLocation} from 'react-router-dom'

function updatePost() {
    function UseQuery() {
        return new URLSearchParams(UseLocation().search);
    }
    const query = useQuery();
    return (
        <div>
            {query.get('idPost')}
        </div>
    )
}



export default updatePost
